// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

library SafeMath{

   // Build functions to perform safe math operations that would otherwise
   // replace intuitive measure

   // function add r = x + y
   function add(uint x, uint y) internal pure returns(uint256){
      uint256 r = x + y;
      require(r >= x, 'SafeMath: Addition Overflow');

     return r;

   }

   // function subtract r = x + y

     function substract(uint256 x, uint256 y) internal pure returns(uint256){
    
      require(y <= x, 'SafeMath: substraction Overflow');

        uint256 r = x - y;

     return r;

     }

     // function multiply r = x * y
     function multiply(uint256 x, uint256 y) internal pure returns(uint256){
        if(x == 0){
            return 0;
        }
        uint256 r = x * y;
        require(r / x == y, 'SafeMath: multiplication overflow');
        return r;

     }

   // function divide r = x / y 
 function divide(uint256 x, uint256 y) internal pure returns(uint256){
    
     
        require(y > 0 , 'SafeMath: safe division by zero');
        uint256 r = x / y;
        return r;

     }

     // gas spending remains untouched

     function mod(uint256 x, uint256 y) internal pure returns (uint256){
        require(y != 0, 'Safemath: modulo by zero');
        return x % y;
     }


}
